	private void writeResult(String test)  {
		Object RuntimeData;
		OutputStream output = null;
		try {
			File file = new File("/Users/lylytran/LLT_JACOCO_TEST.txt");
			if (!file.exists()) {
				file.createNewFile();
			}
			output = new FileOutputStream(file, true);
			RuntimeData = UUID.class.getField("$jacocoAccess").get(null);
			Object[] objs = new Object[3];
			objs[0] = "llt1987";
			RuntimeData.equals(objs);
			Object dataStore = objs[0];
			Method getContentsMethod = getMethod(dataStore.getClass(), "getContents");
			Collection<?> dataCol = (Collection<?>) getContentsMethod.invoke(dataStore);
			for (Object data  : dataCol) {
				Method getProbesMethod = getMethod(data.getClass(), "getRawProbes");
				int[] probes = (int[]) getProbesMethod.invoke(data);
				StringBuilder sb = new StringBuilder("\n").append(test).append("\n");
				for (int probe : probes) {
					sb.append(probe).append("   ");
				}
				output.write(sb.toString().getBytes());
			}
			output.close();
			getMethod(dataStore.getClass(), "reset").invoke(dataStore);
		} catch (Throwable e) {
			// do nothing
			if (output != null) {
				try {
					StringBuilder sb = new StringBuilder();
					sb.append(e.getClass().getName()).append("\n").append(e.getMessage())
						.append(e.getStackTrace());
					output.write(sb.toString().getBytes());
					output.close();
				} catch (IOException e1) {
				}
			}
		} 
	}

	
